"132850":{"id":"132850","name":"A Coreia em um Prato: Cold Noodle","slug":"a-coreia-em-um-prato-cold-noodle","original_title":"냉면 랩소디","overview":"Refrescante e saboroso, o \"macarrão frio\" é muito popular no verão coreano. Conheça sua jornada, desde o preparo até o afeto que envolve este prato tão querido.","first_air_date":"2021-08-20","episode_run_time":48,"vote_average":4.7,"number_of_seasons":1,"number_of_episodes":2,"created_by":[],"production_companies":["KBS"],"genres":["Documentário"],"certification":"10","backdrop_path":"https://image.tmdb.org/t/p/original/28y14U8Xi3SqdV9hj0kiLwKQ4H6.jpg","poster_path":"https://image.tmdb.org/t/p/original/FjevlHR5PMDdeSnN5DQA0yAWhE.jpg","cast":["백종원"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/FjevlHR5PMDdeSnN5DQA0yAWhE.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/FjevlHR5PMDdeSnN5DQA0yAWhE.jpg","air_date":"2021-08-20","episode_count":2,"overview":"N/A","vote_average":10,"episodes":{"1":{"name":"Episódio 1","overview":"Para que complicar? À moda de Pyongyang, a tradicional sopa fria da Coreia aposta no minimalismo. Afinal, a felicidade é uma comidinha simples e deliciosa.","air_date":"2021-08-20","runtime":0,"still_path":"https://image.tmdb.org/t/p/original/sI85tOAfaD9rgSwqOkRdz9EcTXy.jpg","vote_average":10},"2":{"name":"Episódio 2","overview":"A tendência da vez: jovens chefs modernizando pratos tradicionais, como a sopa fria coreana. Paik Jong-won tenta fazer esta iguaria no estilo da ilha de Jeju.","air_date":"2021-08-20","runtime":0,"still_path":"https://image.tmdb.org/t/p/original/oUjdXEeMLqErWI61ASBqtQ7nIzQ.jpg","vote_average":0}}}}},
