"134675":{"id":"134675","name":"As Três Irmãs","slug":"as-tres-irmas","original_title":"작은 아씨들","overview":"Três irmãs que cresceram sozinhas e na pobreza se envolvem em uma conspiração com pessoas ricas e poderosas.","first_air_date":"2022-09-03","episode_run_time":75,"vote_average":8,"number_of_seasons":1,"number_of_episodes":12,"created_by":["정서경","김희원"],"production_companies":["Studio Dragon"],"genres":["Drama","Mistério","Action & Adventure"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/vk6bPEyGdublRolHie9h41RiKwP.jpg","poster_path":"https://image.tmdb.org/t/p/original/gjWCBpkbbE7eCe7au2mT3MhK6Uq.jpg","cast":["김고은","남지현","박지후","위하준","엄지원"],"trailer":"NrgTj_PYdaE","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/gjWCBpkbbE7eCe7au2mT3MhK6Uq.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/gjWCBpkbbE7eCe7au2mT3MhK6Uq.jpg","air_date":"2022-09-03","episode_count":12,"overview":"Três irmãs que cresceram sozinhas e na pobreza se envolvem em uma conspiração com pessoas ricas e poderosas.","vote_average":8.4,"episodes":{"1":{"name":"Episódio 1","overview":"Oh In-joo busca ajuda de uma colega de trabalho após um incidente com a mãe que a deixa sem dinheiro. Oh In-kyung investiga um caso de quatro anos atrás.","air_date":"2022-09-03","runtime":78,"still_path":"https://image.tmdb.org/t/p/original/lFzY5Qj1Wz6MNTf1Ws139WYWOGC.jpg","vote_average":7},"2":{"name":"Episódio 2","overview":"Após descobrir o segredo surpreendente de Jin Hwa-young, In-joo suspeita que um diretor financeiro seja o responsável pelo esquema de assassinato.","air_date":"2022-09-04","runtime":67,"still_path":"https://image.tmdb.org/t/p/original/ab7w9F4DHMYobIEvSgQTVRNuRvk.jpg","vote_average":7},"3":{"name":"Episódio 3","overview":"In-kyung faz um escândalo na festa de comemoração do prêmio que Park Hyo-rin ganhou. In-joo faz uma visita a um hospital para entregar uma orquídea e pedir um conselho.","air_date":"2022-09-10","runtime":77,"still_path":"https://image.tmdb.org/t/p/original/gHF9MZClR8D0DjFIwgkHcMVi1In.jpg","vote_average":7},"4":{"name":"Episódio 4","overview":"Em um jardim secreto, Won Sang-a pede a Oh In-hye que desenho seu retrato. In-joo e In-kyung discutem sobre o dinheiro encontrado.","air_date":"2022-09-11","runtime":68,"still_path":"https://image.tmdb.org/t/p/original/UBwAwFrOFi5HjiY9PYSfaw27I8.jpg","vote_average":6},"5":{"name":"Episódio 5","overview":"In-joo e In-kyung arranjam novos empregos e buscam respostas para algumas perguntas. Sang-a faz uma viagem de última hora e acaba provocando uma reação inesperada.","air_date":"2022-09-17","runtime":74,"still_path":"https://image.tmdb.org/t/p/original/AhUS0scrVHkZosTmkwufSdQdnFE.jpg","vote_average":10},"6":{"name":"Episódio 6","overview":"In-joo e In-hye precisam tomar uma decisão depois de encontrarem uma evidência surpreendente. In-kyung enfrenta as consequências de atrair a atenção da mídia.","air_date":"2022-09-18","runtime":73,"still_path":"https://image.tmdb.org/t/p/original/16bww1M0K5Hn7FSWHmXMI5MeP7X.jpg","vote_average":10},"7":{"name":"Episódio 7","overview":"Ainda se recuperando dos últimos eventos, as irmãs precisam refletir sobre o passado para tentar encontrar a verdade. In-kyung descobre um segredo e In-joo bola um plano.","air_date":"2022-09-24","runtime":75,"still_path":"https://image.tmdb.org/t/p/original/kZ3JOak7Bwg7Q6yRxo0lwY9kI65.jpg","vote_average":0},"8":{"name":"Episódio 8","overview":"In-joo viaja e é recebida de maneira surpreendente, o que a deixa ainda mais confusa. In-hye e Hyo-rin tentam ajudar Sang-a, que foi trancada em casa.","air_date":"2022-09-25","runtime":80,"still_path":"https://image.tmdb.org/t/p/original/byALTp3r4uuHRs4qo58YEaJXfyC.jpg","vote_average":0},"9":{"name":"Episódio 9","overview":"In-joo corre perigo após a visita de uma mulher misteriosa. In-kyung tenta fazer um acordo para salvar a irmã mais velha.","air_date":"2022-10-01","runtime":71,"still_path":"https://image.tmdb.org/t/p/original/hMv4NVKXBhwqK2QDmQIthD8JYEC.jpg","vote_average":0},"10":{"name":"Episódio 10","overview":"Park Jae-sang enfrenta uma ameaça. In-hye e Hyo-rin conseguem ajuda para tentar um recomeço. In-kyung descobre uma maneira de revelar a verdade.","air_date":"2022-10-02","runtime":72,"still_path":"https://image.tmdb.org/t/p/original/zFbcCZS6nf5fbv67I1i9VRHazIR.jpg","vote_average":0},"11":{"name":"Episódio 11","overview":"Jae-sang toma uma atitude drástica. Na sequência, as irmãs enfrentam a ira de adversários familiares, recentemente encorajados com grande poder.","air_date":"2022-10-08","runtime":74,"still_path":"https://image.tmdb.org/t/p/original/6kuzioNEKUq9k8tQv5KX06KGCJm.jpg","vote_average":10},"12":{"name":"Episódio 12","overview":"Durante a audiência de Oh In-joo, uma aparição bombástica no tribunal causa comoção. As emoções aumentam quando perguntas persistentes são finalmente respondidas.","air_date":"2022-10-09","runtime":83,"still_path":"https://image.tmdb.org/t/p/original/scuyGUxkdblEkZ9u54pHOOTzqaq.jpg","vote_average":10}}}}},
